export default class Header extends React.Component {
    render() {
        return (
          <div className="header" id="myHeader">
            <Menu/>
              <img src={Mark} width="200vh" alt="mark"/>
                <h1>Bergamo Creations</h1>
                <p>Eccentrify your identity</p>
          </div>
        );
    }
}
